import React from 'react';
import DashboardService from '../services/DashboardService';
import { Link, Navigate, Route } from "react-router-dom";

class Dashboard extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      photos:[],
      username: '',
      photoname: ''
    }
  }

  componentDidMount() {
    // console.log(this.props.route.params.username);
    DashboardService.getPhotos().then((Response) => {
      this.setState({photos: Response.data})
    });
  }

  getPhotos = (e) => {
    e.preventDefault();
    let photoname = { photoname: this.state.photoname };
    DashboardService.searchPhoto(photoname).then((Response) => {
      console.log("response: " + Response.data);
      if (Response.data !== '') {
        navigate('searchresults', {
          photoname: this.state.photoname
        });
      } else {
        alert("No Results");
      }
    }).catch((error) => {
      console.log(error.response);
    });

  }

  render () {
    return (
      <div>
        <h1 className="text-center">Photo List</h1>
        <Link className='btn btn-primary' to="/">Logout</Link>
        <Link className='btn btn-primary' to="/addPhoto">Add Photo</Link>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <input type="text" onChange={e => setUserName(e.target.value)} />
        <button className='btn btn-success' onClick={this.getPhotos}>Search</button>



        {/* <input type="file" name="file"></input> */}
        <table className='table table-striped'>
          <thead>
            <tr>
              <td>Photo ID</td>
              <td>Photo name</td>
              <td>User name</td>
            </tr>
          </thead>
          <tbody>
            {
              this.state.photos.map(
                photo =>
                <tr key = {photo.id}>
                    <td> {photo.id} </td>
                    <td> {photo.photoname} </td>
                    <td> {photo.username} </td>
                </tr>
              )
            }
          </tbody>
        </table>
      </div>
    )
  }
}

export default Dashboard;
